Von der Spitze des Berges geht sie hinüber bis an die Wasserquelle von Nephtoa, und kommt bis an die Dörfer des Gebirges Ephron, sodann wendet sie sich gegen Baala, das ist Kariathiarim, die Waldstadt;
und von Baala zieht sie sich westlich bis an das Gebirge Seir herum, und geht hinüber an der Seite des Berges Jarim gegen Norden nach Cheslon, und geht nach Bethsames herab, und hinüber nach Thamna;
dann läuft sie nordwärts weiter nach der Seite von Akkaron, und neigt sich nach Sechrona, geht über den Berg Baala, kommt nach Jebneel, und endet nach Westen mit der Grenze des großen Meeres.
